eee6c069e68265941a11a02ee6eec51b73968dcc:
query Entry($id: uuid!) {
  entry: entry_by_pk(id: $id) {
    id
    text
    date
  }
}

8e7212fd3fe73704610e6319d16de551f41a4b0d:
subscription EntryUpdates($id: uuid!) {
  entry: entry_by_pk(id: $id) {
    id
    text
    date
    emotions {
      joy
      love
      optimism
      trust
      surprise
      sadness
      anger
      disgust
      fear
      pessimism
      id
    }
  }
}
